          //         : `/page/${x + 1}`
          //       : `/admin/productlist/${x + 1}`
          //   }
          // >
            <Pagination.Item active={x + 1 === page} key={x+1}>{x + 1}</Pagination.Item>
        ))}
      </Pagination>
    )
  )
}

export default Paginate
